import React from "react";

const ResultBox = ({ result }) => {
  if (!result) {
    return (
      <div className="p-4 border rounded bg-gray-100 text-gray-600">
        No result yet
      </div>
    );
  }

  // Convert result to string safely
  const resultStr = String(result);

  return (
    <div className="p-4 border rounded bg-green-100 text-green-800 font-semibold">
      {resultStr.toLowerCase()}
    </div>
  );
};

export default ResultBox;
